/**
*****
** THIS BLOCK HAS THE FOLLOWING REQUIREMENTS
** - CartoDB.js (http://docs.cartodb.com/cartodb-platform/cartodb-js.html)
*****
**/

/**
* Language Strings
*/
SirTrevor.Locales.en.blocks.cartodb = {
  title: 'CartoDB Map',
  paste: 'Paste CartoDB.js URL here',
  message: 'Enter the CartoDB.js URL supplied when you share from CartoDB.',
  labels: {
    mapContainer: 'Map preview - Drag the map to set its center point',
    zoomLevel: 'Zoom level - Choose the level to zoom the map to',
  }, 
};

/**
* Block Config
*/
SirTrevor.Blocks.Cartodb = SirTrevor.Block.extend({
  
  type: 'cartodb',
  pastable: true,
  droppable: true,

  title: function() { return i18n.t('blocks:cartodb:title'); },

  icon_name: 'default',

  drop_options: {
    html: '<div class="st-block__message" style="text-align: center;"><p>' +
          '<img src="data:image/png;base64,"/>' +
          '<p><%= i18n.t("blocks:cartodb:message") %></p></div>',
  },

  paste_options: {
    html: '<input type="text" placeholder="<%= i18n.t("blocks:cartodb:paste") %>" class="st-block__paste-input st-paste-block">',
  },

  loadData: function(data) {
    if (typeof data === 'undefined') { data = {}; }
    if (typeof data.mapid === 'undefined') { data.mapid = ''; }
    if (typeof data.zoom === 'undefined') { data.zoom = ''; }
    if (typeof data.centerLat === 'undefined') { data.centerLat = null; }
    if (typeof data.centerLon === 'undefined') { data.centerLon = null; }

    this.addMap(data);
  },

  onBlockRender: function() {
    if(this.$editor[0].children.length == 0){
      this.loadData();
    } 
  },

  onContentPasted: function(event) {
    this.setAndLoadData({
      mapid: event.target.value,
      zoom: 5,
      centerLat: null,
      centerLon: null
    });
  },  

  addMap: function(data) {
    if(data.mapid !== '' && data.zoom !== '') {
      var rand = Math.floor(Math.random()*101);
      var mapName = 'map-' + rand;
      var zoomName = 'zoom-' + rand;
      var centerLatName = 'center-lat-' + rand;
      var centerLonName = 'center-lon-' + rand;

      var $mapContainerLabel = $('<label>', {
        style: 'margin-top: 10px',
      }).html(i18n.t('blocks:cartodb:labels:mapContainer'));

      var $mapContainer = $('<div>', {
        id: mapName,
        style: 'height: 400px;',
        class: 'cartodb-container',
      });

      var $zoomInputLabel = $('<label>', {
        'for': zoomName,
        style: 'margin-top: 10px',
      }).html(i18n.t('blocks:cartodb:labels:zoomLevel'));

      var $zoomInput = $('<input>', {
        name: 'zoom',
        id: zoomName,
        type: 'number',
        min: 0,
        class: 'zoom form-control',
        value: data.zoom,
      });

      var $latInput = $('<input>', {
        name: 'centerLat',
        id: centerLatName,
        type: 'hidden',
        value: data.centerLat,
      });

      var $lonInput = $('<input>', {
        name: 'centerLon',
        id: centerLonName,
        type: 'hidden',
        value: data.centerLon,
      });

      this.$inputs.hide();
      this.$editor.append($mapContainerLabel)
                  .append($mapContainer) 
                  .append($zoomInputLabel)
                  .append($zoomInput)
                  .append($latInput)
                  .append($lonInput)
                  .show();

      setTimeout(function() {
        if(typeof cartodb !== 'undefined') {
          cartodb.createVis(mapName, data.mapid, {
            zoom: data.zoom,
            cartodb_logo: false,
            center_lat: data.centerLat,
            center_lon: data.centerLon,
          }).done(function(vis, layers) {
            var map = vis.getNativeMap();

            var center = map.getCenter();
            $latInput.val(center.lat);
            $lonInput.val(center.lng);

            map.on('zoomend', function(e, i) {
              $zoomInput.val(e.target.getZoom());
            });

            map.on('moveend', function(e, i) {
              center = e.target.getCenter();
              $latInput.val(center.lat);
              $lonInput.val(center.lng);
            });

            $zoomInput.on('keyup', function(e, i) {
              map.setZoom($(this).val());
            });
          });
        }
      }, 1);
    }
  }
});